import React, { Component } from 'react';
import Page from '../Page';
import ContentLoginPage from '../UserComponent/ContentLoginPage';


class LoginPage extends Component {
    constructor(props){
        super(props);
        this.state={
          content:[],
          cateId:this.props.match.params.cateId,
        }
    }

    buildContent(){
        let cateInfo = [];
        cateInfo.push(this.state.cateId);

        let _content = [];
        _content.push(<ContentLoginPage key={2} cateId={cateInfo}></ContentLoginPage>);
        
        return _content;
    }

    componentDidMount(){
        this.setState({
            content: this.buildContent(),
        });
    }

    render() {
        return (
            <div>
             <Page content={this.state.content}></Page>
            </div>
        );
    }
}

export default LoginPage;
